const About = () => (
    <Layout>
        <div>
            <h1 className='container'>About</h1> <hr/>
            <div className='container' style={{textAlign:'center'}}>
                The purpose of this website are for those currently investing in the cryptocurrency bitcoin stock market. <br/>
                Welcome to BitzPrice. 
            </div>
        </div>

    </Layout>
);

export default About;
